import React, { useState } from "react";
import Select from "react-select";
import {useForm} from 'react-hook-form'

const options = [
  { value: "1316168077", label: "juan" },
  { value: "1316166977", label: "Melanie" },
  { value: "1316168577", label: "Vanilla" },
];

const AddRegistro = () => {
  const {register,handleSubmit,formState:{errors}} = useForm()
  const [file, setFile] = useState(null);
  const handleChange =(e)=> {
    e.preventDefault();
    setFile(e.target.files[0])
    console.log(file)
  };
  return (
    <div className="flex flex-col bg-white w-auto p-4 justify-between">
      <label className="mt-4 mb-1" htmlFor="Cedula">
        Paciente
      </label>
      <Select options={options} />
      <label className="mt-4 mb-1" htmlFor="Nombre">
        Examen
      </label>
      <Select className="w-96" options={options} />
      <label className="mt-4 mb-1" htmlFor="Archivo">
        Subir Pdf
      </label>
      <input onChange={handleChange} type="file" name="Archivo" id="Archivo" accept="aplication/pdf" />
      <label className="mt-4 mb-1" htmlFor="Fecha">
        Fecha
      </label>
      <input type="date" name="Fecha" id="Fecha" />
      <input className="w-2/3 my-6 ml-16" type="submit" value="Agregar" />
    </div>
  );
};

export default AddRegistro;
